import { createTransport } from "nodemailer";
import { NextResponse } from "next/server";

export async function POST(req, res) {
  const { name, email, message } = await req.json();

  const transporter = createTransport({
    port: process.env.SMTP_PORT,
    host: process.env.SMTP_HOST,
    auth: {
      user: process.env.SENDER_EMAIL,
      pass: process.env.SENDER_PASSWORD,
    },
    secure: true,
  });

  console.log(name, email, message);

  const mailData = {
    from: process.env.SENDER_EMAIL,
    to: process.env.RECEIVER_EMAIL,
    subject: `Certificate Earned At CertSecure`,
    html: `
		<h2>Congratulations on Your Certification Achievement!</h2>

    <p>Dear Alvin Dsouza,</p>

    <p>Congratulations on earning your Certificate in [Certification Name] from CertSecure! Your hard work and dedication have truly paid off.</p>

    <p>This achievement reflects your commitment to excellence in [specific field], and we are proud to have you on our team. Your success is an inspiration to us all.</p>

    <p>Best regards,<br>
    CertSecure</p>
		`,
    attachments: [
      {
        path: "data:application/pdf;base64,",
      },
    ],
  };

  try {
    const mail = await transporter.sendMail(mailData);
    console.log("Success " + mail.response);
    return res.status(200).json({ success: true, message: "Message Sent" });
  } catch (error) {
    console.log("Error: " + error);
    return res.status(200).json({ success: false, message: "Error" });
  }
}
